class TestSymbolParser(unittest.TestCase):
    """
    Test symbol parsing
    """

    maxDiff = None

    def run_symbol_checks(self, path):
        """
        Checks all bin symbols against expectations
        """

        blobs = []
        for fn in os.listdir(path):
            file = os.path.join(path, fn)
            if os.path.isfile(file):
                blobs.append(file)

        for file in blobs:
            print(file)
            group, symbol_name = os.path.split(file)
            path, group = os.path.split(group)

            with open(file, 'rb') as f:
                expected_symbol = expected[group][symbol_name]
                if 'skip' in expected_symbol:
                    continue
                symbol = read_symbol(f, debug=False)

                converter = DictionaryConverter()
                self.assertEqual(converter.convert_symbol(
                    symbol), expected_symbol)

    def test_lines(self):
        """
        Test line symbol parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'line_bin')
        self.run_symbol_checks(path)

    def test_fills(self):
        """
        Test fill symbol parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'fill_bin')
        self.run_symbol_checks(path)

    def test_markers(self):
        """
        Test marker symbol parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'marker_bin')
        self.run_symbol_checks(path)

    def test_hsv(self):
        """
        Test HSV symbol parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'hsv_bin')
        self.run_symbol_checks(path)

    def test_cmyk(self):
        """
        Test CMYK symbol parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'cmyk_bin')
        self.run_symbol_checks(path)

    def test_ramps(self):
        """
        Test color ramp parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'ramps_bin')
        self.run_symbol_checks(path)

    def test_color_symbol(self):
        """
        Test color symbol parsing
        """
        path = os.path.join(os.path.dirname(
            __file__), 'styles', 'color_symbol')
        self.run_symbol_checks(path)

    def test_guid_parsing(self):
        """
        Test GUID parsing
        """
        self.assertEqual(ObjectRegistry.guid_to_hex('7914e603-c892-11d0-8bb6-080009ee4e41'),
                         b'03e6147992c8d0118bb6080009ee4e41')
        self.assertEqual(ObjectRegistry.hex_to_guid(b'03e6147992c8d0118bb6080009ee4e41'),
                         '7914e603-c892-11d0-8bb6-080009ee4e41')
        self.assertEqual(ObjectRegistry.hex_to_guid(b'f5883d531a0ad211b27f0000f878229e'),
                         '533d88f5-0a1a-11d2-b27f-0000f878229e')


